    data: |
      SELECT ALL + - 43 + - col1 FROM tab0 (FORMAT parquet) cor0 WHERE NOT col1 + ( + - col0 ) * col0 * + + col1 * + - col2 <= + 53;
  - name: tab0

outputs:
  - name: q5267.out
    data: |
      -124
      -44
      -64
